import { useDispatch } from "react-redux"
import { Link, useNavigate } from "react-router-dom"
import '../App.css'
function SideBar(){
    const navigate=useNavigate()
    const dispatch=useDispatch()
    const role=sessionStorage.getItem("role")
    console.log("Role ",role)

    const logout=()=>{
        dispatch({type:'LogOut'})
        sessionStorage.clear();
        navigate("/");
    }
    return(
<div className="list-group list-group-flush">
    <div className="sidebackground">
    {role==="Admin" ? (<>
        <Link to="/dashboard" className="list-group-item">Dashboard</Link>                                                                                                
        <Link to="/customers" className="list-group-item ">Customers</Link>
        <Link to="/open" className="list-group-item ">Open Account</Link>  
        <Link to="/kyc" className="list-group-item ">KYC</Link>                                               
        <Link to="/accounts" className="list-group-item">Accounts</Link>                                                                                         
        <Link to="/breport" className="list-group-item">Bank Report</Link>                                                
        </>):(
            <>
        <Link to="/chome" className="list-group-item list-group-item-info">Home</Link>
        <Link to="/beneficiary" className="list-group-item list-group-item-info">Beneficiary</Link>
        <Link to="/otransfer" className="list-group-item list-group-item-info">Transfer</Link>
        <Link to="/deposit" className="list-group-item list-group-item-info">Deposit</Link>
        <Link to="/cheque" className="list-group-item list-group-item-info">Cheque Book</Link>    
        <Link to="/thistory" className="list-group-item list-group-item-info">History</Link>
    </>)}
    <Link to="/changepwd" className="list-group-item ">Change Password</Link>
    <button onClick={()=>logout()} className="list-group-item ">Logout</button>
    </div>
</div>
    )
}

export default SideBar;
